import React, { Component } from "react";
import Nav from "./Nav";
import itemList from "./ItemList";
import addItem from "./AddItem";

class Home extends Component {
  render() {
    return (
      <div>
        <div>
          <Nav />
        </div>
        <div>
          <addItem />
        </div>
        <div>
          <itemList />
        </div>
      </div>
    );
  }
}

export default Home;
